import React from 'react';
import HornedBeast from './HornedBeast';


class Main extends React.Component {
  render() {
    return (
      <>
        <HornedBeast title={'Goat'} description={'Goat with large horns'} src={'img/Goathorn.jpeg'}/>
        <HornedBeast title={'Mountain Goat'} description={'Large Mountain Goat with Horns'} src={'file:///Users/marthaquintanilla-ramirez/Desktop/Code301/hornedbeast.jpeg'}/>
        <HornedBeast title={'Elasmotherium Beast'} description={'Elasmotherium Beast with Horns'} src={'https://upload.wikimedia.org/wikipedia/commons/4/47/Elasm062.jpg'}/>

      </>
    )

  }
}

export default Main;
